●メーカー名：株式会社ソフト99コーポレーショ　●カラー：650mm　●サイズ/仕様：8mm ●長さ：650mm。●ゴム幅：8mm。 エアロデザイン＋トーナメントワイパー！高さが低くデザイン性に優れたエアロデザインワイパーの特長とあらゆるガラス局面にフィットし、安定した払拭性能を発揮するトーナメント型ワイパーの特長を併せ持つ独自フォルムのデザインワイパーです。輸入車専用のワイパーゴムを採用！撥水シリコーンゴムの硬度を最適化し、高いワイパーアーム圧でもスムーズな払拭と撥水効果が得られます。様々なアーム形状に対応！アーム先端の形状に合わせて選べる6種類のアダプターを予めセット、幅広い車種に対応しています。 

